import Grid from "@mui/material/Grid";
import { Box, Card, CardContent, Typography } from "@mui/material";
import { useEffect, useState } from "react";
export default function Admin() {
  useEffect(() => {
    // getTasks();
    axios
      .get("http://localhost:3002/api/tasks")
      .then((res) => {
        settask(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  const styles = {
    gridContainer: {
      display: "grid",
      placeItems: "center",
    },
    table: {
      borderCollapse: "collapse",
      width: "100%",
    },
    th: {
      border: "1px solid black",
      padding: "8px",
      textAlign: "left",
      backgroundColor: "",
    },
    td: {
      border: "1px solid black",
      padding: "8px",
      textAlign: "left",
    },
  };

  return (
    <div>
      <h1>Admin</h1>
      <Grid
        container
        spacing={2}
        alignItems="stretch"
        style={{
          border: "1px solid white",
          marginTop: "5px",
        }}
      >
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Users</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  ></Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    {/* <h2>
                      <i className="fa-solid fa-list-check"></i>
                    </h2> */}
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Complete Tasks</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  ></Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    {/* <h2>
                      <i className="fa-solid fa-clipboard-list"></i>
                    </h2> */}
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={4}>
          <Card
            variant="outlined"
            sx={{ backgroundColor: "#2b2f33", borderRadius: 2 }}
          >
            <CardContent>
              <Grid container spacing={2} alignItems="stretch">
                <Grid item xs={8} sx={{ p: 2 }}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-center",
                      backgroundColor: "",
                    }}
                  >
                    <h2>Incomplete Tasks</h2>
                  </Box>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-start",
                      backgroundColor: "",
                      mt: 2,
                    }}
                  ></Box>
                </Grid>
                <Grid item xs={4}>
                  <Box
                    sx={{
                      display: "flex",
                      justifyContent: "flex-end",
                      backgroundColor: "",
                    }}
                  >
                    {/* <h2>
                      <i class="fa fa-list-alt" aria-hidden="true"></i>
                    </h2> */}
                  </Box>
                </Grid>
              </Grid>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
      <Grid
        container
        spacing={2}
        alignItems="stretch"
        style={{
          border: "1px solid white",
          marginTop: "20px",
          marginBottom: "5px",
        }}
      >
        <Grid item xs={12}>
          <div style={styles.gridContainer}>
            <table style={styles.table}>
              <tr>
                <th style={styles.th}>ID</th>
                <th style={styles.th}>Username</th>
                <th style={styles.th}>Completed Tasks</th>
                <th style={styles.th}>Incomplete Tasks</th>
              </tr>
              <tr>
                <td style={styles.td}>1</td>
                <td style={styles.td}>John</td>
                <td style={styles.td}>5</td>
                <td style={styles.td}>3</td>
              </tr>
              <tr>
                <td style={styles.td}>2</td>
                <td style={styles.td}>Alice</td>
                <td style={styles.td}>7</td>
                <td style={styles.td}>1</td>
              </tr>
            </table>
          </div>
        </Grid>
      </Grid>
    </div>
  );
}
